import { BrowserRouter, Switch, Route } from "react-router-dom";
import logo from './logo.svg';
import './App.css';
import test from './components/test';


function App() {

  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path="/test" Component={test} />
        </Switch>
      </BrowserRouter>
    </div>
  );
}
